function getCookie(a){var e=null;if(document.cookie&&document.cookie!=""){var d=document.cookie.split(";");for(var c=0;c<d.length;c++){var b=jQuery.trim(d[c]);if(b.substring(0,a.length+1)==(a+"=")){e=decodeURIComponent(b.substring(a.length+1));break}}}return e}$("html").ajaxSend(function(b,c,a){if(!(/^http:.*/.test(a.url)||/^https:.*/.test(a.url))){c.setRequestHeader("X-CSRFToken",getCookie("csrftoken"))}});